                        Jquad(ipquad,1,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi1quad) + coords(kblock,QuadNodes(2),3)*(1-xi1quad) +coords(kblock,QuadNodes(3),3)*(1+xi1quad) - coords(kblock,QuadNodes(4),3)*(1+xi1quad))
                        Jquad(ipquad,2,1) = one/four*(-coords(kblock,QuadNodes(1),1)*(1-xi2quad) - coords(kblock,QuadNodes(2),1)*(1+xi2quad) +coords(kblock,QuadNodes(3),1)*(1+xi2quad) + coords(kblock,QuadNodes(4),1)*(1-xi2quad))
                        Jquad(ipquad,2,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi2quad) - coords(kblock,QuadNodes(2),3)*(1+xi2quad) +coords(kblock,QuadNodes(3),3)*(1+xi2quad) + coords(kblock,QuadNodes(4),3)*(1-xi2quad))
    
                        detJquad(ipquad) = Jquad(ipquad,1,1)*Jquad(ipquad,2,2)-Jquad(ipquad,1,2)*Jquad(ipquad,2,1)
                        do ni=1,size(QuadNodes)
                            nj = QuadNodes(ni)
                            dofni(1:iCORD) = 1+iCORDTOTAL*((nj*1)-1)+(CordRange-1)                             
                            ! DISPLACEMENT !
                            RHS(kblock,dofni) = RHS(kblock,dofni) - pWTquad*ABS(detJquad(ipquad))*pNNQuad(ipQuad,ni)*u(kblock,dofni)*pk
                        end do
                         
                    end if
                    if (ANY(jElem(kblock).eq.Y0_Poly)) then ! Bottom Face
                        QuadNodes = (/1,5,6,2/)
                        do i=1,size(QuadNodes)
                            coordquad(i,:)= (/coords(kblock,QuadNodes(i),1),coords(kblock,QuadNodes(i),3)/)
                        end do
                            
                        Jquad(ipquad,1,1) = one/four*(-coords(kblock,QuadNodes(1),1)*(1-xi1quad) + coords(kblock,QuadNodes(2),1)*(1-xi1quad) +coords(kblock,QuadNodes(3),1)*(1+xi1quad) - coords(kblock,QuadNodes(4),1)*(1+xi1quad))
                        Jquad(ipquad,1,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi1quad) + coords(kblock,QuadNodes(2),3)*(1-xi1quad) +coords(kblock,QuadNodes(3),3)*(1+xi1quad) - coords(kblock,QuadNodes(4),3)*(1+xi1quad))
                        Jquad(ipquad,2,1) = one/four*(-coords(kblock,QuadNodes(1),1)*(1-xi2quad) - coords(kblock,QuadNodes(2),1)*(1+xi2quad) +coords(kblock,QuadNodes(3),1)*(1+xi2quad) + coords(kblock,QuadNodes(4),1)*(1-xi2quad))
                        Jquad(ipquad,2,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi2quad) - coords(kblock,QuadNodes(2),3)*(1+xi2quad) +coords(kblock,QuadNodes(3),3)*(1+xi2quad) + coords(kblock,QuadNodes(4),3)*(1-xi2quad))
    
                        detJquad(ipquad) = Jquad(ipquad,1,1)*Jquad(ipquad,2,2)-Jquad(ipquad,1,2)*Jquad(ipquad,2,1)
                        do ni=1,size(QuadNodes)
                            nj = QuadNodes(ni)
                            dofni(1:iCORD) = 1+iCORDTOTAL*((nj*1)-1)+(CordRange-1)                             
                            ! DISPLACEMENT !
                            RHS(kblock,dofni) = RHS(kblock,dofni) - pWTquad*ABS(detJquad(ipquad))*pNNQuad(ipQuad,ni)*u(kblock,dofni)*pk
                        end do
                    end if
                    if (ANY(jElem(kblock).eq.X1_Poly)) then ! Right Face
                        QuadNodes = (/6,2,3,7/)
                            
                        Jquad(ipquad,1,1) = one/four*(-coords(kblock,QuadNodes(1),2)*(1-xi1quad) + coords(kblock,QuadNodes(2),2)*(1-xi1quad) +coords(kblock,QuadNodes(3),2)*(1+xi1quad) - coords(kblock,QuadNodes(4),2)*(1+xi1quad))
                        Jquad(ipquad,1,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi1quad) + coords(kblock,QuadNodes(2),3)*(1-xi1quad) +coords(kblock,QuadNodes(3),3)*(1+xi1quad) - coords(kblock,QuadNodes(4),3)*(1+xi1quad))
                        Jquad(ipquad,2,1) = one/four*(-coords(kblock,QuadNodes(1),2)*(1-xi2quad) - coords(kblock,QuadNodes(2),2)*(1+xi2quad) +coords(kblock,QuadNodes(3),2)*(1+xi2quad) + coords(kblock,QuadNodes(4),2)*(1-xi2quad))
                        Jquad(ipquad,2,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi2quad) - coords(kblock,QuadNodes(2),3)*(1+xi2quad) +coords(kblock,QuadNodes(3),3)*(1+xi2quad) + coords(kblock,QuadNodes(4),3)*(1-xi2quad))
    
                        detJquad(ipquad) = Jquad(ipquad,1,1)*Jquad(ipquad,2,2)-Jquad(ipquad,1,2)*Jquad(ipquad,2,1)
                        do ni=1,size(QuadNodes)
                            nj = QuadNodes(ni)
                            dofni(1:iCORD) = 1+iCORDTOTAL*((nj*1)-1)+(CordRange-1)                             
                            ! DISPLACEMENT !
                            RHS(kblock,dofni) = RHS(kblock,dofni) - pWTquad*ABS(detJquad(ipquad))*pNNQuad(ipQuad,ni)*u(kblock,dofni)*pk
                        end do
                    end if
                    if (ANY(jElem(kblock).eq.X0_Poly)) then ! Left Face
                        QuadNodes = (/1,5,8,4/)
                            
                        Jquad(ipquad,1,1) = one/four*(-coords(kblock,QuadNodes(1),2)*(1-xi1quad) + coords(kblock,QuadNodes(2),2)*(1-xi1quad) +coords(kblock,QuadNodes(3),2)*(1+xi1quad) - coords(kblock,QuadNodes(4),2)*(1+xi1quad))
                        Jquad(ipquad,1,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi1quad) + coords(kblock,QuadNodes(2),3)*(1-xi1quad) +coords(kblock,QuadNodes(3),3)*(1+xi1quad) - coords(kblock,QuadNodes(4),3)*(1+xi1quad))
                        Jquad(ipquad,2,1) = one/four*(-coords(kblock,QuadNodes(1),2)*(1-xi2quad) - coords(kblock,QuadNodes(2),2)*(1+xi2quad) +coords(kblock,QuadNodes(3),2)*(1+xi2quad) + coords(kblock,QuadNodes(4),2)*(1-xi2quad))
                        Jquad(ipquad,2,2) = one/four*(-coords(kblock,QuadNodes(1),3)*(1-xi2quad) - coords(kblock,QuadNodes(2),3)*(1+xi2quad) +coords(kblock,QuadNodes(3),3)*(1+xi2quad) + coords(kblock,QuadNodes(4),3)*(1-xi2quad))
    
                        detJquad(ipquad) = Jquad(ipquad,1,1)*Jquad(ipquad,2,2)-Jquad(ipquad,1,2)*Jquad(ipquad,2,1)
                        do ni=1,size(QuadNodes)
                            nj = QuadNodes(ni)
                            dofni(1:iCORD) = 1+iCORDTOTAL*((nj*1)-1)+(CordRange-1)                             
                            ! DISPLACEMENT !
                            RHS(kblock,dofni) = RHS(kblock,dofni) - pWTquad*ABS(detJquad(ipquad))*pNNQuad(ipQuad,ni)*u(kblock,dofni)*pk
                        end do
                    end if                    
                end do ! ------------------------ ipquad-loop ------------------------
            
!    !    !===================================================================================================================================
    !    !-----------------------------------STABLE TIME INCREMENT CALCULATION----------------------------------
    !    !===================================================================================================================================
            
            cd = sqrt( (pEM*(one-pNU))/(pRHO*(one+pNU)*(one-two*pNU)) )
            cdT = (pVpoly)*pDif
            Mechtime = (pd_min/cd)
            Thermaltime = (pd_min*pd_min)/(2*cdT)
            TimeMin = minval( (/Mechtime,Thermaltime/) )
            dtimeStable(kblock) = factorStable*TimeMin		
            
